import './App.css';
import Base from './pages/Base';
import {Container, CssBaseline, AppBar,Toolbar,FormatListNumbered} from '@mui/material';
function App() {
  return (
    <>
    <Container maxWidth="sm">
      <CssBaseline />
      <AppBar position="relative">
          <Toolbar>
              <FormatListNumbered />
          </Toolbar>
      </AppBar>

    </Container>
    <main>
      <Base />
    </main>
    </>
  );
}

export default App;
